create table NewVehicleData
(
	VehicleId tinyint not null
		constraint PK_NewVehicleData
			primary key,
	VIN smallint,
	DealerId tinyint,
	Make nvarchar(50),
	Model nvarchar(50),
	Year nvarchar(50),
	Category nvarchar(50),
	Price float,
	Color nvarchar(50),
	Miles int,
	Image nvarchar(max),
	IncentiveId tinyint,
	DiscountPrice nvarchar(50),
	Ratings tinyint,
	image_urls nvarchar(2000) default '' not null
)
go;




